    return (
        <div className="burgers">
            <div className="burger">
            <img src="./images/burger1.jpg" alt="" />
            <div className="info">
                <p className='info_price'>689₽</p>
                <p className='food_name'>Мясная бомба</p>
                <p className='info_gr'>520г</p>
            </div>
            <button className='add'>Добавить</button>
            </div>
        </div>
    )
}

export default Burgers;
